import React from 'react'
import { Link } from "react-router-dom";
import {StyledDiv} from './Navbar.style'

export default function Navbar() {
    return (
        <StyledDiv>
            <Link to="/"> Movies </Link>
            <Link to="/TvShow"> Tv Shows </Link>
            <Link to="/Collection"> Collections </Link>
        </StyledDiv>
    )
}
